            Assert.AreEqual(transaction.Trx.PackedTrx, "d7890c60eee0f2f3935b000000000130a9cbe6aaa416900000000000a0a6930100009086036f2cff00000000a8ed32321100009086036f2cff080e0ad19a8d7cb9da00");
